import React from 'react'

const Course = (course) => {
  const { name, id, parts } = course
  console.log(name);
  console.log(id);
  console.log(parts);

  return (
    <div>
      <h1>{name}</h1>
      <ul>
        {parts.map(part => 
          <li key={part.id}>
            {part.name} {part.exercises}
          </li>
        )}
      </ul>
    </div>
  )

}

export default Course
